import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
       <h1 className="header">Local Storage</h1>
       <GetLocalPosts/>
       <br/>
       <h1 className="header">External API</h1>
       <GetOnlinePosts/>
     </div>
  );
}

export default App;
